import { Paper, Avatar, Typography, ButtonGroup, IconButton } from '@material-ui/core'
import EditIcon from '@material-ui/icons/Edit';
import DeleteIcon from '@material-ui/icons/Delete';
import React, {useState, useEffect} from 'react'

function SearchCards({searchTerm}) {
    const [tableData, setTableData] = useState([])

    useEffect(()=>{
        setTableData(searchTerm)
    })

    return (
        <Paper style={{width: "300px", height: "200px", position: "absolute"}}>
            <div style={{marginLeft: "65%", marginTop: "2%"}}>
                        <ButtonGroup>
                            <IconButton aria-label="Edit">
                                <EditIcon />
                            </IconButton>
                            <IconButton aria-label="Delete">
                                <DeleteIcon />
                            </IconButton>
                        </ButtonGroup> 
                        </div>
            <Avatar style={{marginLeft: "20%", marginTop: "-35px", backgroundColor: "orange", color: "black"}}>T</Avatar>
            <Typography align="left" variant="h5" style={{marginLeft: "10%", marginTop: "10px"}} >{tableData.firstname}</Typography>
            <Typography align="left" variant="h6" style={{marginLeft: "10%"}}>Department</Typography>
            <Typography align="left" variant="subtitle1" style={{marginLeft: "10%"}}>Company</Typography>
            <Typography align="left" variant="subtitle2" style={{marginLeft: "10%"}}>Job Title</Typography>
        </Paper>
    )
}

export default SearchCards
